import React from "react";
import { Drawer, List, ListItem, ListItemIcon, ListItemText, Toolbar, Box, Typography, Divider } from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
import ReportIcon from '@mui/icons-material/Description';
import ListAltIcon from '@mui/icons-material/ListAlt';
import PersonIcon from '@mui/icons-material/Person';
import HelpIcon from '@mui/icons-material/HelpOutline';
import LogoutIcon from '@mui/icons-material/Logout';
import { useNavigate, useLocation } from "react-router-dom";

const drawerWidth = 280;

const navItems = [
  { text: "Dashboard", icon: <DashboardIcon />, path: "/victim_dashboard" },
  { text: "Report Crime", icon: <ReportIcon />, path: "/report_crime" },
  { text: "My Reports", icon: <ListAltIcon />, path: "/victim_reports" },
  { text: "Profile", icon: <PersonIcon />, path: "/profile" },
  { text: "Help & FAQ", icon: <HelpIcon />, path: "/help" },
  { text: "Logout", icon: <LogoutIcon />, path: "/auth/login", logout: true },
];

export default function Sidebar() {
  const navigate = useNavigate();
  const location = useLocation();

  const handleNav = (item) => {
    if (item.logout) {
      // Clear session or token if needed
      navigate(item.path);
    } else {
      navigate(item.path);
    }
  };

  return (
    <Drawer
      variant="permanent"
      sx={{
        width: drawerWidth,
        flexShrink: 0,
        position: 'fixed',
        left: 0,
        top: 0,
        height: '100vh',
        zIndex: 1200,
        [`& .MuiDrawer-paper`]: { 
          width: drawerWidth, 
          boxSizing: 'border-box', 
          background: 'linear-gradient(180deg, #1a202c 0%, #2d3748 100%)',
          color: '#fff',
          borderRight: '1px solid #4a5568',
          position: 'fixed',
          left: 0,
          top: 0,
          height: '100vh'
        },
      }}
    >
      <Toolbar />
      <Box sx={{ px: 3, py: 4 }}>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, mb: 1 }}>
          <Box sx={{ 
            background: 'linear-gradient(135deg, #4fd1c5 0%, #38b2ac 100%)',
            borderRadius: '50%',
            p: 1,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            <PersonIcon sx={{ color: '#fff', fontSize: 24 }} />
          </Box>
          <Typography variant="h6" sx={{ 
            fontWeight: 700, 
            background: 'linear-gradient(135deg, #4fd1c5 0%, #38b2ac 100%)',
            backgroundClip: 'text',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent'
          }}>
            CyberCrime Reports
          </Typography>
        </Box>
        <Typography variant="body2" color="rgba(255,255,255,0.7)" sx={{ pl: 1 }}>
          Victim Portal
        </Typography>
      </Box>
      
      <Divider sx={{ background: '#4a5568', mx: 2 }} />
      
      <List sx={{ px: 2, py: 2 }}>
        {navItems.map((item) => (
          <ListItem
            button
            key={item.text}
            selected={location.pathname === item.path}
            onClick={() => handleNav(item)}
            sx={{
              borderRadius: 2,
              mb: 1,
              background: location.pathname === item.path 
                ? 'linear-gradient(135deg, #4fd1c5 0%, #38b2ac 100%)' 
                : 'transparent',
              color: location.pathname === item.path ? '#fff' : 'rgba(255,255,255,0.8)',
              '&:hover': { 
                background: location.pathname === item.path 
                  ? 'linear-gradient(135deg, #4fd1c5 0%, #38b2ac 100%)'
                  : 'rgba(79, 209, 197, 0.1)',
                color: '#fff'
              },
              transition: 'all 0.2s ease-in-out',
              '& .MuiListItemIcon-root': {
                color: location.pathname === item.path ? '#fff' : 'rgba(255,255,255,0.8)',
                minWidth: 40
              }
            }}
          >
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText 
              primary={item.text} 
              sx={{ 
                '& .MuiTypography-root': {
                  fontWeight: location.pathname === item.path ? 600 : 500,
                  fontSize: '0.95rem'
                }
              }}
            />
          </ListItem>
        ))}
      </List>
    </Drawer>
  );
}
